  \"2013-03-28T01:14:51.780415\",\n\t\"name\": \"national-wetlands-inventory-points\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Wetland point features (typically wetlands
  that are too small to be as area features at the data scale) mapped as part of the
  National Wetlands Inventory (NWI). The National Wetlands Inventory is a national
  program sponsored by the US Fish and Wildlife Service (USFWS). The NWI database
  was funded jointly between the USFWS and the State. The base data was developed
  through interpretation of National Aerial Photography Program (NAPP) imagery (approx.
  1:50,000 scale, typically color-infrared) in conjunction with limited field verification
  studies. Ancillary data sources, particularly USGS Quadrangle Maps and soil surveys,
  were also used in the interpretation process. After interpreting the aerial photographs,
  delineations were transferred to a 1:24,000 scale orthogonal base, digitized, and
  coded in conformance to the USFWS classification scheme and structured into a DLG
  format. The original interpretation/automation effort was performed under contract
  by GEONIX-MARTEL of St. Petersburg, FL. The data were delivered to LMIC, who converted
  it into an ARC/INFO format, and performed some additional processing to prepare
  it for distribution.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
